import React from 'react';

function RegisterationForm() {
  return (
    <form className="register-email-form">
      <h3>Ready to watch? Enter your email to create or restart your membership.</h3>
      <div className="register-email-form-container">
        <ul className="register-email-input">
          <input
            className="register-email-field"
            type="email"
            placeholder="Email Address">
          </input>
        </ul>
        <button className="btn register-btn-start" type="submit" autoComplete="off">
          <span className="register-btn-text">GET STARTED</span>
          <span className="register-btn-arrow"><i className="fas fa-chevron-right"></i></span>
        </button>
      </div>
    </form>
  );
}

export default RegisterationForm;
